import React from 'react'

const Skills = () => {
    return(
        <div className='skills'>
            <h1>Skills.list</h1>
            <br></br>
            <p>
            I have some experience with microcontrollers such as ESP8266, ESP32, ATMEGA382p, Intel 8051 and some others.
            I also know fairly well programming languages such as Assembly, C/C++, Python and Javascript... 
            </p>
            <p>
            Aswell as some good knowledge on System and Network Administration.
            I also have interest in being a Backend/DevOps developer.
            </p>
        </div>
    );
}


export default Skills;
